Carrie is a 1976 American supernatural horror film film directed by Brian De Palma and written by Lawrence D. Cohen, based on the novel Carrie by Stephen King. The film and the novel tell the story of a socially outcast teenage girl, Carrie White, who discovers she possesses psionic power which seems to flare up when she becomes angry. Carrie's powers become apparent after her humiliation by her peers, teachers, and abusive mother, eventually resulting in tragedy. The film stars Sissy Spacek, Piper Laurie, Betty Buckley, Amy Irving, Nancy Allen, William Katt, John Travolta, P.J. Soles and Priscilla Pointer.
